import React, { useEffect, useState } from "react";
import axios from "axios";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // Example filters (Replace these with actual state values from inputs)
  const filters = {
    location: "Pen, Raigad",
    speciality: "Heart",
    experience: 4,
    consultationFee: 200,
    availabilityStatus: "available"
  };

  useEffect(() => {
    const fetchDoctors = async () => {
      setLoading(true);
      setError("");

      try {
        const response = await axios.get("http://localhost:4000/api/doctors/filter", {
          params: filters, // Pass filters dynamically
        });

        console.log("âœ… Fetched Doctors:", response.data); // Log the response
        setDoctors(response.data);
      } catch (err) {
        console.error("ðŸš¨ Error fetching doctors:", err.message);
        setError("Failed to fetch doctors.");
      } finally {
        setLoading(false);
      }
    };

    fetchDoctors();
  }, []); // Runs once when the component mounts

  return (
    <div>
      <h2>Doctor List</h2>

      {loading && <p>Loading doctors...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {doctors.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Location</th>
              <th>Speciality</th>
              <th>Experience (Years)</th>
              <th>Consultation Fee</th>
              <th>Availability</th>
            </tr>
          </thead>
          <tbody>
            {doctors.map((doctor) => (
              <tr key={doctor.id}>
                <td>{doctor.id}</td>
                <td>{doctor.name}</td>
                <td>{doctor.Location}</td>
                <td>{doctor.Speciality}</td>
                <td>{doctor.Experience}</td>
                <td>{doctor.Consultation_Fee}</td>
                <td>
                  {doctor.Availability_Status_9_to_12 === "available" ||
                  doctor.Availability_Status_2_to_5 === "available" ||
                  doctor.Availability_Status_6_to_9 === "available"
                    ? "Available"
                    : "Unavailable"}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        !loading && <p>No doctors found.</p>
      )}
    </div>
  );
};

export default DoctorList;
